import { useState } from "react";
import "./App.css";

export const App = () => {
  const [count, setCount] = useState(0);

  function handleAdd() {
    setCount(count + 1);
    console.log(count);
  }

  function handleSub() {
    setCount(count - 1);
    console.log(count);
  }

  function handleReset() {
    setCount(0);
    console.log(count);
  }

  return (
    <div className="App">
      <div lassName="box">
        <p>{count}</p>
        <button onClick={handleAdd} className="add">
          ADD
        </button>
        <button onClick={handleSub} className="sub">
          SUB
        </button>
      </div>
    </div>
  );
};
